      stepBase={6}
      foregroundColor={Colors.GREEN}
      backgroundColor={Colors.NAVY}
    />
  );
  const description = 'You just started Therapy C evaluation.';
  const navLink = 'List';
  const nextButton = true;

  return (
    <>
      <SharedCard
        title={title}
        image={image}
        description={description}
        navLink={navLink}
        nextButton={nextButton}
      />
    </>
  );
};
